import Link from 'next/link';
import Layout from '../components/Layout';
import Calc from '../components/Calc';


const h1 = {
    fontSize: '72pt',
    fontWeight: 'bold',
    textAlign: 'right',
    letterSpacing: '-8px',
    color: '#f0f0f0',
    margin: '-40px 0px'
}


const p = {
    margin: '0px',
    color: '#666',
    fontSize: '16pt'
}


export default () => (
    <Layout header="Calc" title="calculator">
        <Calc />
        <hr />
        <div>
            <Link href="/">
                <button>&lt;&lt; Back to Top</button>
            </Link>
        </div>
    </Layout>
);
